window.bookSummaryJSON = "<p><b>Ciaran had a mission of his own: an omega on whom to breed sons.</b></p> <p>It was in a very tiny village that the omega Ebby had grown up, surrounded by women who knew what she would become as well as a few men to whom she was unattractive, all of whom participated in training her to defend herself. They had also all vowed to protect her with their lives.</p> <p>And in the end, because of him, that was exactly what they had done.</p> <p>Ciaran, an alpha born in one of those more successful city-states, had risen through the ranks of what passed for the army to command a battalion that combed the wasteland, defeating enemies and making the occasional ally. Their military mission was to collect whatever might benefit them immediately - or the base, when they returned. But he was conducting a mission of his own for that which he had wanted all his life: an omega on whom to breed sons.</p> <p>They had received intelligence that there was something very valuable hidden in a village not far away. And there was.</p> <p>Ebby.</p> <p><b>Publisher's note:</b> This steamy post-apocalyptic romance contains power exchange scenes.</p>"; 
